import Question from './Question'

export default class QuestionCollection extends React.Component {
    questionList = (props) => {
        return props.questions.map((question,index) => (<Question  question={question}/>))
    }
   render() {
       return (
           <div id="questions_container">
                { this.questionList()}
                {/* Hello */}
           </div>
       )
   }
}
